const Setting = () => {

    const handleSubmit = (e) => {
        e.preventDefault();

    }

    return(
        <form onSubmit={handleSubmit}>
            <SelectField label="Category" />
            <SelectField label="DIfficulty" />
            <SelectField label="Type" />
            <TextField />

            <Box mt={3} width="100%">
                <Button fullWidth variant="contained" type="submit">
                    Get Started
                </Button>
            </Box>

        </form>
    )
}

export default Setting;
